import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { makeServer } from "./server";
import {CartProvider} from './Context/CardContext';
import { BrowserRouter } from 'react-router-dom';

// Call make Server
makeServer();

ReactDOM.render(
  <React.StrictMode>
    <CartProvider>
      <BrowserRouter>
        <App />
      </BrowserRouter>
      </CartProvider>
  </React.StrictMode>,
  document.getElementById("root")
);
